# 通用搜索函数，避免代码重复
async def _perform_search(
    query: str,
    category: str,
    language="zh",
    safe_search=1,
    time_range="",
    output_format: str = "html",
) -> TextContent:
    """
    通用搜索处理函数
    """
    if not query or not isinstance(query, str):
        raise ValueError("Query parameter is required and must be a string")

    if not API_URL:
        raise ValueError("SEARXNG_API_URL environment variable is not set")

    if not check_rate_limit():
        raise RuntimeError("Rate limit exceeded")

    headers = merge_headers({})
    params = {
        "q": query,
        "language": language,
        "time_range": time_range,
        "safe_search": safe_search,
        "categories": category,
        "theme": "simple",
        "format": 'html' if 'searx.bndkt.io' in API_URL else 'json',
    }

    search_url = f"{API_URL}/search"

    try:
        async with httpx.AsyncClient() as client:
            response = await client.post(
                search_url, data=params, headers=headers, timeout=REQUEST_TIMEOUT
            )
            response.raise_for_status()
            if params['format'] == 'json':
                data = response.json()
            else:
                data = response.text

        if params['format'] == 'json':
            return _parse_response_json(data, output_format, category)
        else:
            return TextContent(type="html", text=data)

    except httpx.HTTPError as e:
        logger.error(f"HTTP Error in {category} search: {str(e)}")
        raise RuntimeError(f"HTTP Error: {str(e)}")
    except json.JSONDecodeError as e:
        logger.error(f"JSON decode error in {category} search: {str(e)}")
        raise RuntimeError(f"JSON decode failed: {str(e)}")
    except Exception as e:
        logger.error(f"Unexpected error in {category} search: {str(e)}")
        raise RuntimeError(f"Unexpected error: {str(e)}")

def _parse_response_json(data: dict, output_format: str, category: str) -> TextContent:
    """
    解析JSON响应数据
    :param data: JSON响应数据
    :param output_format: 输出格式，json或html
    :param category: 搜索类别
    :return: 解析后的TextContent对象
    """
    if "results" not in data or not data["results"]:
        return TextContent(type="text", text="未找到相关结果")

    results = []
    if output_format == "json":
        for result in data["results"]:
            result_data = {
                "title": escape(result.get("title", "")),
                "url": escape(result.get("url", "")),
                "description": escape(result.get("content", "")),
            }

            # 根据类别添加特定字段
            if category == "images":
                result_data.update(
                    {
                        "img_src": escape(result.get("img_src", "")),
                        "thumbnail_src": escape(result.get("thumbnail_src", "")),
                    }
                )
            elif category == "videos":
                result_data.update(
                    {
                        "publishedDate": result.get("publishedDate", ""),
                        "length": result.get("length", ""),
                        "thumbnail": escape(result.get("thumbnail", "")),
                        "iframe_src": escape(result.get("iframe_src", "")),
                    }
                )
            elif category == "map":
                result_data.update(
                    {
                        "address": result.get("address", {}),
                        "longitude": result.get("longitude", ""),
                        "latitude": result.get("latitude", ""),
                        "type": result.get("type", ""),
                    }
                )
            elif category == "music":
                result_data["thumbnail"] = escape(result.get("thumbnail", ""))
            elif category == "news":
                result_data["publishedDate"] = result.get("publishedDate", "")

            results.append(result_data)

        return TextContent(
            type="text", text=json.dumps(results, ensure_ascii=False, indent=2)
        )
    else:
        # HTML 格式输出
        return _format_html_results(data["results"], category)


