def _format_html_results(results: list, category: str) -> TextContent:
    """
    根据类别格式化HTML结果
    """
    formatted_results = []

    for result in results:
        title = escape(result.get("title", ""))
        url = result.get("url", "")
        desc = escape(result.get("content", ""))

        if category == "images":
            img_src = result.get("img_src", "")
            thumbnail_src = result.get("thumbnail_src", img_src)
            img_html = (
                f"<img src='{thumbnail_src}' width='120' alt='{title}' />"
                if thumbnail_src
                else ""
            )
            html = (
                f"<div style='margin-bottom: 1em;'>"
                f"<h3><a href='{url}' target='_blank'>{title}</a></h3>"
                f"{img_html}"
                f"<p>{desc}</p>"
                f"</div>"
            )
        elif category == "videos":
            thumbnail = result.get("thumbnail", "")
            length = result.get("length", "")
            published_date = result.get("publishedDate", "")
            img_html = (
                f"<img src='{thumbnail}' width='120' alt='{title}' />"
                if thumbnail
                else ""
            )
            meta_info = []
            if length:
                meta_info.append(f"时长: {length}")
            if published_date:
                meta_info.append(f"发布: {published_date}")
            meta_html = f"<small>{' | '.join(meta_info)}</small>" if meta_info else ""
            html = (
                f"<div style='margin-bottom: 1em;'>"
                f"<h3><a href='{url}' target='_blank'>{title}</a></h3>"
                f"{img_html}"
                f"{meta_html}"
                f"<p>{desc}</p>"
                f"</div>"
            )
        elif category == "map":
            address = result.get("address", {})
            address_name = address.get("name", "") if address else ""
            location_type = result.get("type", "")
            longitude = result.get("longitude", "")
            latitude = result.get("latitude", "")

            location_info = []
            if address_name:
                location_info.append(f"地址: {address_name}")
            if location_type:
                location_info.append(f"类型: {location_type}")
            if longitude and latitude:
                location_info.append(f"坐标: {latitude}, {longitude}")

            location_html = (
                f"<small>{' | '.join(location_info)}</small>" if location_info else ""
            )
            html = (
                f"<div style='margin-bottom: 1em;'>"
                f"<h3><a href='{url}' target='_blank'>{title}</a></h3>"
                f"{location_html}"
                f"<p>{desc}</p>"
                f"</div>"
            )
        elif category == "music":
            thumbnail = result.get("thumbnail", "")
            img_html = (
                f"<img src='{thumbnail}' width='80' alt='{title}' />"
                if thumbnail
                else ""
            )
            html = (
                f"<div style='margin-bottom: 1em;'>"
                f"<h3><a href='{url}' target='_blank'>{title}</a></h3>"
                f"{img_html}"
                f"<p>{desc}</p>"
                f"</div>"
            )
        elif category == "news":
            published_date = result.get("publishedDate", "")
            date_html = (
                f"<small>发布时间: {published_date}</small>" if published_date else ""
            )
            html = (
                f"<div style='margin-bottom: 1em;'>"
                f"<h3><a href='{url}' target='_blank'>{title}</a></h3>"
                f"{date_html}"
                f"<p>{desc}</p>"
                f"</div>"
            )
        else:
            # 默认格式（用于general、it、science、files、social_media）
            thumbnail = result.get("thumbnail", "")
            img_html = (
                f"<img src='{thumbnail}' width='120' alt='{title}' />"
                if thumbnail
                else ""
            )
            html = (
                f"<div style='margin-bottom: 1em;'>"
                f"<h3><a href='{url}' target='_blank'>{title}</a></h3>"
                f"{img_html}"
                f"<p>{desc}</p>"
                f"</div>"
            )

        formatted_results.append(html)

    return TextContent(type="text", text="\n\n".join(formatted_results))


